Another album from Kyoto Jazz Massive

Kyoto Jazz Massive is a musical project specialising in broken beat and electronic styles, consisting of the two brothers Okino Shuya and Okino Yoshihiro. Although the brothers DJed in the late 1980 and were remixing and composing as far back as the early 1990s, they were largely popularised by the British Radio 1 DJ Gilles Peterson in around 2001. The brothers are currently signed to Compost Records.
